import React from 'react';
import './App.css';
import Home from './app/pages/Home';
import TurnosOnline from './app/pages/TurnosOnline';
import ReservarTurno from './app/pages/ReservarTurno';
import Contacto from './app/pages/Contacto';

import HomeBO from './app/pages/HomeBO';
import ABMMedico from './app/pages/ABMMedico';
import ListarMedicos from './app/pages/ListarMedicos';


import { store } from './app/store';
import { Provider } from 'react-redux';
import * as serviceWorker from './serviceWorker';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const App = () => {
  return (
    <Provider store={store}>
      <Router>
        <Switch>
          <Route path={"/home"} exact strict render={
            () => {

              return (<Home />)
            }
          } >
          </Route>
          <Route path={"/turnosOnline"} exact strict render={
            () => {
              return (<TurnosOnline />)
            }
          } >
          </Route>
          <Route path={"/reservarTurno"} exact strict render={
            () => {
              return (<ReservarTurno />)
            }
          } >
          </Route>
          <Route path={"/contacto"} exact strict render={
            () => {
              return (<Contacto />)
            }
          } >
          </Route>
          <Route path={"/homeBO"} exact strict render={
            () => {
              return (<HomeBO />)
            }
          } >
          </Route>
          <Route path={"/abmMedico"} exact strict render={
            () => {
              return (<ABMMedico />)
            }
          } >
          </Route>
          <Route path={"/listarMedicos"} exact strict render={
            () => {
              return (<ListarMedicos />)
            }
          } >
          </Route>

        </Switch>
      </Router>
    </Provider>
  );
}

export default App;
